          item.imgList = shuffledImages.slice(
            currentIndex,
            currentIndex + numImages
          );
          currentIndex += numImages;
        });
        console.log(
          "%c ..........godoflightList.........",
          "color:#31ef0e",
          godoflightList
        );
        return godoflightList;
